import React from "react";
import urgentIcon from "./urgent.svg";
import highIcon from "./High.svg";
import mediumIcon from "./Medium.svg";
import lowIcon from "./Low.svg";
import nopriorityIcon from "./Nopriority.svg";
import todoIcon from "./Todo.svg";
import backlogIcon from "./Backlog.svg";
import inprogressIcon from "./Inprogress.svg";

const Icon = ({ priority }) => {
 switch (priority) {
    case "Urgent":
      return <img src={urgentIcon} alt="Urgent Icon" />;
    case "High":
      return <img src={highIcon} alt="High Icon" />;
    case "Medium":
      return <img src={mediumIcon} alt="Medium Icon" />;
    case "Low":
      return <img src={lowIcon} alt="Low Icon" />;
    case "No priority":
      return <img src={nopriorityIcon} alt="No Priority Icon" />;
    case "Todo":
      return <img src={todoIcon} alt="No Priority Icon" />;
    case "Backlog":
      return <img src={backlogIcon} alt="No Priority Icon" />;
    case "In progress":
      return <img src={inprogressIcon} alt="No Priority Icon" />;

    default:
      return null; // Handle the case where no icon matches
 }
};

export default Icon;
